          <div className='titleContent'>
            <img src="/building-icon.svg" width={40} height={40} />
            <div className='headerStyling'>
              <p className="titleStyling">{title}</p>
              <p className="addressStyling">{address}</p>
            </div>
          </div>
          <div className='priceContent'>
            <p className='psfStyling'>
              ${psf_min_string} - ${psf_max_string} psf
            </p>
            <p className='subpriceStyling'>{subprice_label}</p>
          </div>
        </div>
      </div>
    </div>
  )
}
